import React from 'react';
import { StyleSheet, View } from 'react-native';
import { YMaps, Map, Placemark } from '@pbe/react-yandex-maps';
import { SafeAreaView } from 'react-native';
import { Title } from 'react-native-paper';
import { homeStyle } from './home.style';

const HomeScreen = () => {
  const handlePlacemarkClick = (e) => {
    e.preventDefault();
    console.log('Placemark clicked');
  };

  return (
    <SafeAreaView style={homeStyle.page}>
      <Title>Map</Title>
      <YMaps 
        enterprise
        query={{
          load: "package.full", 
          apikey: "af7c0f53-a625-45b6-9e95-fd90a65132des"
        }}>
        <Map
          style={homeStyle.container}
          defaultState={{ center: [54.738276, 20.489808], zoom: 11 }}
        >
          <Placemark geometry={[54.738276, 20.489808]} onClick={handlePlacemarkClick} />
        </Map>
      </YMaps>
    </SafeAreaView>
  );
};

export default HomeScreen;
